import React, { Component } from 'react';
import UserLookup from './components/UserLookup';
import { Title, Grid, Cell } from 'react-mdc-web/lib';


export default class Dashboard extends Component {

  render() {
    return (
      <Grid>
        <Cell col={6}>
          <UserLookup />
        </Cell>
      </Grid>
    );
  }
}
